ベルトループ完備の防水防寒パンツ<br><br>素材：[表地]ポリエステル100%（PVC）<br>
　　　[裏地]ポリエステル100%<br>
　　　[中綿]ポリエステル100%<br>
<br>
●ベルトループ、前開きZIP完備<br>
●立体縫製で動きやすい<br>
●パンツ裾を踏まない『ヘムアジャスタ』機能付き<br><br>※画像のカラーは、撮影時の照明等の具合により実物と異なる可能性がございます。
なお、商品の色の見え方と実物の色は、お客様のご使用されているパソコン・モニターの環境等により多少異なる場合がございますのでご了承ください。<br><br><br><br>
